import React, { Component } from 'react';
import { Button } from 'reactstrap';

export default class KhuNhaList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: "",
            tenKhuNha: "",
            diaChi: "",
            quanLyKhuNha: "",
            SDT: "",
            openAddModal: false
        }
    }

    render() {
        return (
            <div className="row khu-nha">
                <div className="add">
                    <button>+ Thêm khu nhà</button>
                </div>

                <div>
                    <table className="table">
                        <tr>
                            <th>STT</th>
                            <th>Tên khu nhà</th>
                            <th>Địa chỉ</th>
                            <th>Người quản lý</th>
                            <th>Số điện thoại</th>
                            <th>Chỉnh sửa</th>
                            <th>Xóa</th>
                        </tr>
                    </table>
                </div>
            </div>
        )
    }
}
